import styled from "styled-components";

const FooterContainer = styled.div`
    width: 100%;
    height: 500px;
    display: flex;
    flex-direction: column;
    background-color: #1f1f1f
`;

export function Footer(props) {
    return <FooterContainer>
        footer
    </FooterContainer>
}
